import React, {Component} from 'react'; 

class Button extends Component{

    render(){
        return (
            <div className="container">
                <button className={`btn-${this.props.flt}`} onClick={() => this.props.action(this.props.symbol)}>{this.props.symbol}</button>
            </div>
        )
    }

}
export default Button;
